import '../styles/AboutMe.css'

const AboutMe = () => {
    return (
        <div className="aboutContainer">
            <div className="selectorContainer">
                <div className="selectorText">
                    Model. Which is best for you?
                </div>
                <div className="selector">
                    Test
                </div>
            </div>
        </div>
    );
}

export default AboutMe;
